import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Navigation />
      <Switch>
        <Route exact path="/" component={Accueil} />
        <Route path="/profile" component={Profile} />
        <Route path="/vegetables" component={Vegetables} />
        <Route path="/basket" component={Basket} />
      </Switch>
    </div>
  );
}

export default App;
